import { GET_REGION_SUCCESS, GET_STATE_SUCCESS } from '../actions/actionSignUp';
const initialState = {
  region: [],
  state: [],
};
interface Action {
  type: string;
  payload?: any;
}
export interface InitSignup {
  region: object;
  state: object;
}
const SignUpReducer = (state = initialState, action: Action) => {
  switch (action.type) {
    case GET_REGION_SUCCESS:
      return {
        region: action.payload,
      };
    case GET_STATE_SUCCESS:
      return {
        state: action.payload,
      };
    default:
      return state;
  }
};
export default SignUpReducer;
